  \"2016-05-31T01:05:38.937478\",\n\t\"name\": \"alaska-steller-sea-lion-and-northern-fur-seal-argos-telemetry-data-archive\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Alaska Ecosystems Program of the NOAA
  Alaska Fisheries Science Center National Marine Mammal Laboratory conducts research
  and monitoring on Steller sea lions and northern fur seals in the Bering Sea, Aleutian
  Island, and Gulf of Alaska marine ecosystems. Our research projects focus primarily
  on abundance, trends, distribution, and foraging behavior. As part of this work,
  deployment of satellite-linked telemetry tags are a primary research tool. This
  data set represents all data from these tags deployed on all species and across
  a variety of research projects and collaborations. Locations are calculated and
  provided by the Argos satellite system (http://www.argos-system.org/). In many cases,
  the data messages also include encoded behavior data (e.g. dive behavior, haul-out
  behavior) and additional software is required to decode these data. Data are, generally,
  in the same format as originally delivered from Argos/CLS America and no quality
  assurance or quality control measures have been implemented.\",\n\t\"license_title\":
